import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import HomePage from './pages/HomePage';
import StockPage from './pages/StockPage';
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          {/* Define the route for HomePage */}
          <Route path="/" element={<HomePage />} />

          {/* Define the route for StockPage */}
          <Route path="/stock-page" element={<StockPage />} />

          {/*Define the route for the 3rd page*/}
        <Route path="/" element={<StockTable />} />
        <Route path="/stock-details/:ticker" element={<StockDetails />} />
      </Routes>
      </div>
    </Router>
  );
}

export default App;
